<li><code>list-item</code>像块类型元素一样显示，并添加样式列表标记。</li>
<li><code>table</code>此元素会作为块级表格来显示。</li>
<li><code>inherit</code>规定应该从父元素继承<code>display</code>属性的值。</li>
