<li>握手成功后，浏览器向服务器发送<code>HTTP请求</code>，请求数据包。</li>
<li>服务器处理收到的请求，将数据（或错误信息，或重定向的新的<code>url</code>地址）返回至浏览器。</li>
<li>浏览器收到<code>HTTP响应</code>。</li>
