<p><code>setState</code>之后发生了什么？</p>
<p><strong>简单版本：</strong>
<code>react</code>利用状态队列机制实现了<code>setState</code>的“异步”更新，避免频繁的重复更新<code>state</code>。</p>
<p>首先将新的<code>state</code>合并到状态更新队列中，然后根据更新队列和<code>shouldComponentUpdate</code>的状态来判断是否需要更新组件。</p>
