<p><code>new Vue()</code>实例中，<code>data</code>可以直接是一个对象，在<code>vue</code>组件中，<code>data</code>为什么必须是一个函数呢？</p>
<p>因为组件是可以复用的，在<code>JavaScript</code>里对象是引用关系。如果组件中的<code>data</code>是一个对象，那么组件实例中的<code>data</code>属性值会相互污染，产生副作用。所以组件中的<code>data</code>必须是一个函数，这样每个组件实例就可以维护一份被返回对象的独立的拷贝，<code>new Vue</code>实例是不会被复用的，因此不会存在以上问题。</p>`,r:{minutes:1.42,words:427},t:"组件中的data为什么必须是一个函数",y:"a"}}],["/VUE/%E7%BB%84%E4%BB%B6%E4%B8%AD%E7%9A%84key.html",{loader:()=>m(()=>import("./组件中的key.html-_F8SpyQf.js"),__vite__mapDeps([205,1])),meta:{d:1724829877e3,e:`
